To solve the problem of finding the values of $x$ for which the function $y=\frac{x+1}{x^2-2x+1}$ has vertical asymptotes, we need to determine where the denominator is equal to zero, as vertical asymptotes occur where the function is undefined due to division by zero.

The denominator of the function is $x^2-2x+1$. This can be factored as $(x-1)^2$. Setting the denominator equal to zero, we get:
\[
(x-1)^2 = 0
\]
Solving for $x$, we find:
\[
x-1 = 0 \implies x = 1
\]

Thus, the function has a vertical asymptote at $x=1$. 

$\boxed{1}$

