\begin{align*}
0 &= -y^2 + 4y - 4 \\
0 &= y^2 - 4y + 4
\end{align*}

이제 이 이차방정식을 풀어봅시다. 이것은 완전제곱식입니다:

\begin{align*}
0 &= (y - 2)^2
\end{align*}

이 방정식의 해는 $y = 2$입니다. 따라서, 이 포물선은 $y$-축과 한 점에서만 만나므로 $y$-절편은 1개입니다.

