먼저, $A\, (5,-5)$와 $B\, (-1,-1)$ 사이의 거리를 계산해야 합니다. 두 점 사이의 거리를 구하는 공식은 $\sqrt{(x_2-x_1)^2 + (y_2-y_1)^2}$ 입니다.

\[
\begin{align*}
\text{길이} AB & = \sqrt{(-1-5)^2 + (-1+5)^2} \\
& = \sqrt{(-6)^2 + (4)^2} \\
& = \sqrt{36 + 16} \\
& = \sqrt{52} \\
& = 2\sqrt{13}
\end{align*}
\]

이 직각 삼각형의 빗변의 길이는 $2\sqrt{13}$입니다. 이등변 직각 삼각형의 경우, 빗변의 길이를 이용해 각 직각변의 길이를 구할 수 있습니다. 각 직각변의 길이는 빗변의 길이를 $\sqrt{2}$로 나눈 값입니다.

\[
\begin{align*}
\text{직각변의 길이} & = \frac{2\sqrt{13}}{\sqrt{2}} \\
& = \sqrt{2} \cdot \sqrt{13} \\
& = \sqrt{26}
\end{align*}
\]

이제 직각삼각형의 넓이를 구합니다. 직각삼각형의 넓이는 두 직각변의 길이를 곱한 후 2로 나눈 값입니다.

\[
\begin{align*}
\text{넓이} & = \frac{1}{2} \cdot \sqrt{26} \cdot \sqrt{26} \\
& = \frac{1}{2} \cdot 26 \\
& = 13
\end{align*}
\]

따라서, 삼각형 $ABC$의 넓이는 $\boxed{13}$입니다.

