question:
 $a,b,c$는 $13$보다 작은 양의 정수이며 다음과 같은 조건을 만족한다.
\begin{align*}
2ab+bc+ca&\equiv 0\pmod{13}\\
ab+2bc+ca&\equiv 6abc\pmod{13}\\
ab+bc+2ca&\equiv 8abc\pmod {13}
\end{align*}
이때 $a+b+c$를 $13$으로 나눈 나머지를 구하시오.

$A$와 $B$가 양의 정수일 때, 다음과 같은 조건을 만족하는 $A \cdot B$를 구하시오.

\[
\begin{array}{c@{}c@{\;}c@{}c@{}c@{}c}
& & & A & B_{9}\\
&+& & & A_{9}\\
\cline{2-5}
& & & B & 0_{9}\\
\end{array}
\]

답은 10진수로 나타내시오 (첨자 불필요).

다음 덧셈 문제가 성립하는 기수 \( b \)의 값을 구하세요: 
\[
\begin{array}{@{}c@{\;}c@{}c@{}c@{}c@{}c} 
& & 6 & 6 & 5 & 1_b \\ 
+ & & & 1 & 1 & 5_b \\ 
\cline{1-6} 
& 1 & 0 & 0 & 6 & 6_b\\ 
\end{array}

다음 합동식을 만족하는 가장 작은 음이 아닌 정수 $a$를 구하세요: \begin{align*}
&a\equiv 2\pmod 3,\\
&a\equiv 4\pmod 5,\\
&a\equiv 6\pmod 7,\\
&a\equiv 8\pmod 9.
\end{align*}

1과 100 사이에 두 개의 정수가 있는데, 각각 다음 조건을 만족합니다:

