223是最小的由一个一位数素数和两个不同的两位数素数相乘得到的积。一位数素数有2, 3, 5, 7，两位数素数有11, 13, 17, 19, 23...等。为了找到最小的乘积，我们应选择最小的素数进行相乘。2是最小的一位数素数，11和13是最小的两个不同的两位数素数。因此，$2 \times 11 \times 13 = 223$。

$\boxed{223}$
